text:
Please #GiveBlood if you can. The blood you give is a lifeline in an emergency.

After having a #COVIDVaccine, please wait 7 full days before giving blood. If you've had side-effects from the vaccine, please wait 28 days from your recovery.

@GiveBloodNHS https://t.co/5TKhyEsWuB https://t.co/oZI7fIctow
